import React from 'react';

const SportsList = ({ sports }) => {
  return (
    <ul>
      {sports.map(sport => (
        <li key={sport._id}>{sport.title} - {sport.type} - {new Date(sport.date).toLocaleDateString()}</li>
      ))}
    </ul>
  );
};

export default SportsList;
